import { Fragment } from "react";
import CartIcon from "./CartIcon";

import classes from './Header.module.css';

const Header = (props) => {
    return (
        <Fragment>
            <div className={classes.header}>
                <div className={classes.navBar}>
                    <section>
                        <h1>SOOL</h1>
                    </section>
                    <section>
                        <span>로그인</span>
                        <CartIcon />
                    </section>
                </div>
            </div>
        </Fragment>
    )
};

export default Header;
